<script type="text/javascript">
	function htmlEscape(str) {
		return String(str)
				.replace(/&/g, '&amp;')
				.replace(/"/g, '&quot;')
				.replace(/'/g, '&#39;')
				.replace(/</g, '&lt;')
				.replace(/>/g, '&gt;');
	}

	$(function() {
		$(".fragment").each(function(i,node) {
			var $node = $(node);
			$node.find('.lineno').remove();
			$node.html("<pre><code class=\"prettyprint\">" +
					htmlEscape( $node.text() ) +"</code></pre>");
		});
	});
</script>
